import './InstructionsPage.css';

function clickSuccess(){
    alert("FML");
}


function Instructions(props){
    const whichTabToShow = props;
    if(whichTabToShow==="GettingStarted"){
        return <h1>Getting Started</h1>
    }
    else if(whichTabToShow==="Shape"){
        return <h1>Shape</h1>
    }
}

export default function InstructionsPage() {
    return (
    <div class="instructMainPage">
        <div class="containerOuter">
            <div class="containerInner">
                <nav>

                    <div class="tabButton" type="button" onClick={() => Instructions("GettingStarted")}>GETTING STARTED</div>
                    <div class="tabButton" type="button" onClick={() => Instructions("Shape")}>SHAPE</div>
                    <div class="tabButton" type="button" onClick={clickSuccess}>COLOR</div>
                    <div class="tabButton" type="button" onClick={clickSuccess}>BRIGHTNESS</div>
                    <div class="tabButton" type="button" onClick={clickSuccess}>SIZING</div>
                    <div class="tabButton" type="button" onClick={clickSuccess}>ROTATION</div>
                </nav>

            </div>
        </div>
        <Instructions whichTabToShow={"GettingStarted"} />
    </div>

    );
}
